/**************************************************************************
 Progress bar handling
**************************************************************************/
class Progress
{
public:
  Progress(const int maxPos)
  {
    m_maxPos = maxPos;
    m_pos = 0;
    m_pProgressBar = new mpc::display::ProgressBar();
    WM_AttachWindow(m_pProgressBar->GetWMHandle(), WM_GetDesktopWindow());
    m_pProgressBar->SetMinMaxPos(0, m_maxPos);
    m_pProgressBar->SetClientArea(20,160,219,175);
    #ifdef USE_STN_COLOURS
    m_pProgressBar->SetVisible();
    m_pProgressBar->SetPercentVisible();
    WM_SetStayOnTop(m_pProgressBar->GetWMHandle(), 1);
    #endif
  }
  ~Progress()
  {
    delete m_pProgressBar;
  }
  void Handle(void)
  {
    m_pos++;
    if (m_pos < m_maxPos)
    {
      if ((m_pos % 200) == 0)
      {
        m_pProgressBar->SetPos(m_pos);
        m_pProgressBar->Run();
        WM_Exec();
        FEED_DOG();
      }
    }
    else if (m_pos == m_maxPos)
    {
      m_pProgressBar->SetPos(m_maxPos);
      m_pProgressBar->Run();
      WM_Exec();
    }
  }
private:
  int m_maxPos, m_pos;
  mpc::display::ProgressBar* m_pProgressBar;
};
